  `fanwefx_status` tinyint(4) DEFAULT NULL COMMENT '结算状态：0-未结算;1-已结算;2-已取消',
  PRIMARY KEY (`id`),
  KEY `order` (`order_id`,`goods_id`)
) ENGINE=InnoDB AUTO_INCREMENT=38 DEFAULT CHARSET=utf8 COMMENT='订单商品表';

