  `is_all` tinyint(4) DEFAULT '0' COMMENT '是否是全国店评价 1：是 0：否',
  `goods_id` int(11) DEFAULT NULL COMMENT '商品编号',
  `goods_star` tinyint(4) DEFAULT NULL COMMENT '商品评分',
