  `ischeck` int(11) DEFAULT '0' COMMENT '是否签收',
  `data` text COMMENT '状态详细',
  `type` tinyint(1) unsigned DEFAULT '0' COMMENT '0物流公司 1其他物流 2无需物流',
  `remark` text COMMENT '备注',
